import changeVolume from '../actions/changeVolume';

const defaultState = true;

function reducer(state = defaultState, action) {
    switch (action.type) {
        case 'turnOnOff': {
            return
            action.payload
        }
        default:
            return state;
    }
}

export default reducer;
